def special_factorial(n):
    def factorial(x):
        if x == 0 or x == 1:
            return 1
        else:
            return x * factorial(x-1)

    result = 1
    for i in range(1, n+1):
        result *= factorial(i)
    return result

def words_in_sentence(sentence):
    def is_prime(n):
        if n <= 1:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    return ' '.join([word for word in sentence.split() if is_prime(len(word))])

def specialFilter(nums):
    def is_odd_and_greater_than_10(n):
        n = abs(n)  # To handle negative numbers
        if n <= 10:
            return False
        first_digit = int(str(n)[0])
        last_digit = int(str(n)[-1])
        return first_digit % 2 == 1 and last_digit % 2 == 1

    return sum(is_odd_and_greater_than_10(num) for num in nums)

